// components/Home.js

import React from 'react';
import styles from './styles/Home.module.css';
import { motion } from 'framer-motion';

function Home() {
  return (
    <motion.div
    initial={{ opacity: 0 }}
    animate={{ opacity: 1 }}
    exit={{ opacity: 0 }}
  >
    <div className={styles.homeContainer}>
      <h1 className={styles.title}>Yash Bhatia</h1>
      <h2 className={styles.subtitle}>Graduate Assistant at Saint Louis University</h2>
      <p>Welcome to my portfolio website!</p>
    </div>
    </motion.div>
  );
}

export default Home;
